import { hexbin as d3Hexbin } from 'd3-hexbin';

const hexbin = d3Hexbin(); // Instantiate hexbin

export const Marks = ({ bins }) => {
    return (
        <g className="marks">
            {bins.map((bin, i) => {
                if (bin.length === 0) return null; // Skip empty bins

                const centroid = hexbin.centroid(bin); // Get the centroid 

                console.log("Centroid:", centroid); // Log centroid for debugging

                return (
                    <circle
                        key={i}
                        cx={centroid[0]}
                        cy={centroid[1]}
                        r={1000} // Temporary radius for visibility
                        fill="red" // Color for visibility
                    />
                );
            })}
        </g>
    );
};
